import React from "react";
import { Button } from "reactstrap";
import {ToastContainer,toast} from "react-toastify";

function App() {
  return (
    <div>
        <ToastContainer></ToastContainer>
      <h1>Simple project</h1>
      <Button color="primary">Click</Button>
    </div>
  );
}

export default App
